15	2			\N	2016-06-29 16:52:05.141156-07	2016-06-29 16:52:05.141185-07	f	f	This will be wiki for all devops/networks related information documenting our network infrastructure and everything needed to maintain and develop our networks + servers in the FTTA.\r\n\r\n[TOC]\r\n\r\n# Netguard\r\n\r\nNetguard has two main functions; DNS(Domain Name System) Server and Firewall. IP address is configured as such, \r\n\r\n| eth0 | 192.168.10.1 (trainee net) |\r\n|------|----------------------------|\r\n| eth1 | 10.0.8.20    (office net)  |\r\n\r\nYou can connect to the server with the username such as,\r\n\r\n     ssh ftta@192.168.10.1\r\n\r\nIf you are prompted for the password, please ask Joon \r\n\r\n## Configure Netguard as DNS\r\n\r\nConfiguring DNS Server in Netguard is to add a mapping and domain in the files for DNS binding. Once you are logged into the Netguard, \r\n\r\n     cd /etc/bind/zones\r\n     ls *.db *.arpa\r\n\r\nThere are two kinds of files with a extension of `.db` and `.arpa`. Please look for `ftta.lan.db` and `rev.10.168.192.in-addr.arpa`. This is for trainee DNS bindings. Once you edit these files, restart `bind9` service.\r\n\r\n     sudo /etc/init.d/bind9 restart\r\n\r\n## Configure Netguard as Firewall\r\n\r\n`Firewall Builder` is deployed to maintain our network. For more details, please refer the official site, [Firewall Builder](http://www.fwbuilder.org/4.0/how_it_works.shtml).\r\n\r\n\r\n### [1] Limited Internet Access\r\n\r\n\r\n\r\n### [2] Permanent Internet Access\r\n\r\n# Audio/Video Broadcasting\r\n# Network Diagram\r\n\r\n\r\n\r\n\r\n\r\n\r\n- /User/Time\r\n- first save current config\r\n\r\n- time adding example: SAMP team sat internet access: (ex 12:00 pm  4:30pm)\r\n* time slot works until 11:59 pm * - if day is over, then calculate accordingly\r\n(GMT  7 hours ahead from Pacific)\r\n(PT)\r\n\r\n- after compile and installation, three procedures\r\n\r\nexecute followings\r\n- sudo bash /home/ftta/fw_stop.sh\r\n- sudo killall java\r\n- sudo service networkApp start\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n- get MAC address of computer \r\n(pic)\r\n\r\n- \r\n\r\n\r\n\r\nnetwork diagram	Networks Service Wiki	4	5	2109
