up of the object configurations, \r\n\r\n\r\n# Audio/Video Broadcasting\r\n# Network Diagram\r\n\r\n\r\n\r\n\r\n\r\n\r\n- /User/Time\r\n- first save current config\r\n\r\n- time adding example: SAMP team sat internet access: (ex 12:00 pm  4:30pm)\r\n* time slot works until 11:59 pm * - if day is over, then calculate accordingly\r\n(GMT  7 hours ahead from Pacific)\r\n(PT)\r\n\r\n- after compile and installation, three procedures\r\n\r\nexecute followings\r\n- sudo bash /home/ftta/fw_stop.sh\r\n- sudo killall java\r\n- sudo service networkApp start\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n- get MAC address of computer \r\n(pic)\r\n\r\n- \r\n\r\n\r\n\r\nnetwork diagram	Networks Service Wiki	4	17	2109
