50	15			\N	2016-07-01 16:52:11.238805-07	2016-07-01 16:52:11.238835-07	f	f	This will be wiki for all devops/networks related information documenting our network infrastructure and everything needed to maintain and develop our networks + servers in the FTTA.\r\n\r\n[TOC]\r\n\r\n# Netguard\r\n\r\nNetguard has two main functions; DNS(Domain Name System) Server and Firewall. IP address is configured as such, \r\n\r\n| eth0 | 192.168.10.1 (trainee net) |\r\n|------|----------------------------|\r\n| eth1 | 10.0.8.20    (office net)  |\r\n\r\nYou can connect to the server with the username such as,\r\n\r\n     ssh ftta@192.168.10.1\r\n\r\nIf you are prompted for the password, please ask Joon \r\n\r\n## Configure Netguard as DNS\r\n\r\nConfiguring DNS Server in Netguard is to add a mapping and domain in the files for DNS binding. Once you are logged into the Netguard, \r\n\r\n     cd /etc/bind/zones\r\n     ls *.db *.arpa\r\n\r\nThere are two kinds of files with a extension of `.db` and `.arpa`. Please look for `ftta.lan.db` and `rev.10.168.192.in-addr.arpa`. This is for trainee DNS bindings. Once you edit these files, restart `bind9` service.\r\n\r\n     sudo /etc/init.d/bind9 restart\r\n\r\n## Configure Netguard as Firewall\r\n\r\n`Firewall Builder` is deployed for firewall in the network. For more details, please refer the official site, [Firewall Builder](http://www.fwbuilder.org/4.0/how_it_works.shtml).\r\n\r\nBefore configure anything in the firewall, please make a backup copy of current object configurations in backup directory.\r\n\r\n[image:1]\r\n\r\n### [1] Limited Internet Access\r\n\r\nAfter making backup of the object configurations, \r\n\r\n[image:2 align:left]\r\n    1. Select any object under `/User/Time/`. And then, right click on the object and duplicate it\r\n    \r\n[image:3]\r\n    2. Change the object name and configure 'start time', 'end time' and check mark on 'date'. This example shows internet access request between 12:00 pm PT and 4:30 pm PT\r\n`*Important Notes*`\r\n(1) Time is `GMT` time based(7 hours ahead from Pacific), therefore please calculate carefully based on Pacific Time when configuring. \r\n(2) Time can go upto `11:59pm', so if the requested time goes over 12:00 am, you have to configure with two separate objects. For instances, SMEP team requested internet access from 2pm PT to 6pm PT. Then, one object is from 9pm GMT to 11:59pm GMT, and the other file is from 12:00am GMT to 1am GMT.\r\n\r\n[image:4]\r\n    3. Once you finished configuration, select the right policy. This example shows 'SMEP' team policy\r\n\r\n[image:5]\r\n    4. Select all configured objects and drag them into the `Time` column in the policy\r\n\r\n[image:6]\r\n    5. Compile it and make sure there is no error\r\n\r\n[image:7]\r\n    6. Install it\r\n\r\n_**Any problems? Please refer troubleshooting at the bottom**_\r\n\r\n### [2] Permanent Internet Access\r\n\r\n**First of all, please get the user's MAC address of the wireless interface.** Open the terminal of the computer and then execute,\r\n\r\n     ifconfig (Unix or Mac systems)\r\n     ipconfig (Windows)\r\n\r\nAfter making backup of the object configurations, please follow steps below.\r\n\r\n[image:8]\r\n    1. Select any object under `/User/Objects/Hosts` and duplicate it\r\n\r\n[image:9]\r\n    2. Put the guest MAC address into the object\r\n\r\n[image:10]\r\n    3. Select a right policy group \r\n\r\n[image:11]\r\n    4. Drag the configured object into the name list of the selected policy group\r\n\r\n## Trouble Shooting \r\n\r\n###_**Why firewall is not working according to the configurations?**_\r\n\r\nThis happens if some services need to be restarted. Please execute, \r\n \r\n     sudo bash /home/ftta/fw_stop.sh\r\n     sudo killall java\r\n     sudo service networkApp start\r\n	Networks Support Service Wiki	4	36	1781
