67	1			\N	2016-07-13 11:32:00.734388-07	2016-07-13 11:32:00.734418-07	f	f	*Note: This should be one of the most comprehensive pages in the wiki,\r\nas it should mention most of the devices on the network by name (with\r\ncorresponding links).*\r\n\r\nNetwork Design\r\n==============\r\n\r\nThis page provides an overview of the FTTA's physical network and its\r\nattached devices. Such devices include: servers, desktops, laptops,\r\nprinters, routers, switches, and wireless access points.\r\n\r\nNetwork Architecture\r\n--------------------\r\n\r\n![Network Architecture](http://ap.ftta.lan/media/wiki/images/14/4b6b566b2a89477d8d7454524e520df1/8f3c9b1cd8791fded3520b066ef5f96ce96fb3f7.png)\r\n\r\n### FTTA Firewall General Architecture\r\n\r\n1. FTTA is the only zone that the Sonic Wall firewall recognizes.\r\n2. fttaVPN users are treated as FTTA.\r\n3. Machines in FTTA can initiate connections to the internet.\r\n4. Officenet and TraineeNet? are separated by Netguard, a machine that lives within the FTTA zone and runs a firewall program.\r\n\r\n### Implications of general architecture and network separation\r\n\r\n1. Rule set A is handled by the Sonic Wall firewall.\r\n2. Rule set B is handled by the NetGuard? firewall.\r\n3. Rule set B should be configured in the following manner:\r\n    - TraineeNet? can initiate file service to Officenet at all times.\r\n    - Officenet can initiate all connections to TraineeNet? at all times.\r\n    - TraineeNet? can initiate web connections and web services through OfficeNet? at specified times (Trainees' Day Off).\r\n    - TraineeNet? can initiate web connections through Officenet at specified times and on specific devices (special internet requests).\r\n\r\n\r\n#### Officenet\r\n\r\nManaged by LSM and Brother Curt Kennard\r\n\r\n#### Traineenet\r\n\r\nTraineeNet is managed by \\[wiki:Netguard\\] Eth1 (static IP:\r\n**10.0.8.20**) on Netguard interfaces with the WAN side of\r\nTraineenet.[br](br "wikilink") Eth0 (static IP: **192.168.10.1**) on\r\nNetguard interfaces with the LAN side of Traineenet.\r\n\r\n#### Security\r\n\r\nSecurity cameras (see \\[wiki:DVR\\]) and door keypads are also networked\r\nover Officenet.\r\n\r\n### Servers\r\n\r\nThis list should include all the machines located in the network_closet:\r\n\r\n - Attendance\r\n - Netguard\r\n - Modifying NetGuard\r\n\r\nThe following have been retired\r\n\r\n - Dispenser\r\n - Dispenser2\r\n - Gatekeeper\r\n\r\n### Workstations\r\n\r\nWorkstations on the FTTA network belong to one or more of the following\r\ncategories: 1) Office; 2) Designated Service; 3) Attendance Stations.\r\nAll workstations on Traineenet should have an entry in the\r\n\\[wiki:Netguard\\#Firewall firewall\\] policy.\r\n\r\n#### Office\r\n\r\nOffice workstations are those that are physically located in the front\r\noffice, TA brothers' office, and back (library) offices. These machines\r\nhave been placed on \\[wiki:Officenet\\] which gives them 24/7 internet\r\naccess as well as access to Corporate (see \\[wiki:FTTA-Server\\#Corporate\r\nCorporate\\] on \\[wiki:FTTA-Server\\]).\r\n\r\n#### Support Staff\r\n\r\nThese machines include all workstations used by FTTA serving ones that\r\nare not located in the front office. Such machines include\r\n\\[wiki:Maintenance\\], etc...\r\n\r\n#### Designated Service\r\n\r\nAttendance Monitors, Special Projects, and other designated services may\r\non occasion use workstations that have been provided for their use. In\r\nsome cases, a workstation may be reserved for a single designated\r\nservice group. These workstations should not be placed on\r\n\\[wiki:Officenet\\].\r\n\r\n#### Attendance Stations\r\n\r\nAttendance stations (AS) are provided for trainees to access the\r\n\\[wiki:Attendance Attendance Server\\]. All attendance stations are on\r\nTraineenet. During the normal training schedule, internet access is\r\nlimited to Sunday after team time through Monday before the Monday Night\r\nRevival meeting.\r\n\r\nSee \\[wiki:attendance\\_stations attendance stations\\] for detailed\r\ninformation.\r\n\r\n### Laptops\r\n\r\n\\[wiki:"FTN laptops" FTN laptops\\] are provided for trainees' use. These\r\nlaptops are stored in the TA brothers office. Trainees can check-out an\r\nFTN by entering their name in the FTTA Trainee Laptop binder located on\r\nthe same shelf as the laptops.\r\n\r\n### Printers\r\n\r\nSee \\[wiki:printers\\].\r\n\r\n\r\n[image:12]\r\n    Network Architecture	Network Architecture	20	\N	1798
