74	1			\N	2016-07-13 13:09:12.29597-07	2016-07-13 13:09:12.295999-07	f	f	### How to "release" latest dev code into production.\r\n\r\nRun on the ap.ftta.lan server in ~/:\r\n```\r\nsudo ./production.sh\r\n```\r\n\r\nThis script will do the following:\r\n\r\n1. Back up db, push backup to dropbox repo\r\n2. git pull latest changes\r\n3. Collect static files\r\n4. makeallmigrations\r\n5. migrate\r\n6. restart wsgi server to load in the most up to date python files\r\n\r\nIf you're prompted for passphrase, it's ```changeme```\r\n\r\n\r\n\r\n### Dropbox Repo (backup + scripts)\r\n\r\nWe run a free dropbox git repo to keep a nightly db backup of database changes as well as important scripts changes. So if the whole server crashed we would have a reasonable way of restoring all the information from out backup.\r\n\r\n### How to pull dropbox repo unto your local computer:\r\n\r\n1. Existing dropbox owner needs to share the ```repos``` folder (contains ```dj_ap_server``` repo) with your dropbox account.\r\n2. You can't actually see the db files in this dropbox folder. To actually see the files, you need to run\r\n\r\n```\r\ngit clone dropbox://repos/dj_ap_server\r\n```\r\n\r\n\r\nsomewhere outside this folder to checkout the git repository.\r\n\r\nThen, you must checkout the ```database``` branch by doing:\r\n\r\n```\r\ngit checkout database\r\n```\r\n\r\nThere should then be 3 files:\r\n\r\nap_data.sql  ap_full.sql  ap_schema.sql\r\n\r\n#### Scripts\r\nYou can checkout the scripts on the ```scrips``` branch by:\r\n\r\n```\r\ngit checkout scripts\r\n```\r\n	Production Server (ap.ftta.lan)	21	\N	1798
75	2			\N	2016-07-13 13:25:46.751601-07	2016-07-13 13:25:46.75163-07	f	f	### How to "release" latest dev code into production.\r\n\r\nRun on the ap.ftta.lan server in ~/:\r\n```\r\nsudo ./production.sh\r\n```\r\n\r\nThis script will do the following:\r\n\r\n1. Back up db, push backup to dropbox repo\r\n2. git pull latest changes\r\n3. Collect static files\r\n4. makeallmigrations\r\n5. migrate\r\n6. restart wsgi server to load in the most up to date python files\r\n\r\nIf you're prompted for passphrase, it's ```changeme```\r\n\r\nIf everything runs smoothly, this deployment should result in no downtime for the running server but still exercise to deploy during low volume hours in the event the latest code is not stable.\r\n\r\n### View all error logs\r\n```\r\ntaillogs\r\n```\r\n\r\n### View Production Postgres db\r\nYou can tunnel into production server db directly via pgadmin3\r\n\r\nhost: ap.ftta.lan\r\nuesrname: postgres\r\npassword: Ask AP admin.\r\n\r\n### Cron jobs\r\nThe server runs periodic tasks every day/week to the up-to-date maintainence of the server (i.e. database backups, scripts backups, absentee roster emails sent out...)\r\n\r\nThese are all registered within the crontab. To view, execute:\r\n\r\n```\r\ncrontab -l\r\n```\r\n\r\nTo run the backup manually:\r\n\r\n```\r\ncd ~/deployment/ap/cron_jobs\r\nworkon prod\r\npython task.py\r\n```\r\n\r\n### Dropbox Repo (backup + scripts)\r\n\r\nWe run a free dropbox git repo to keep a nightly db backup of database changes as well as important scripts changes. So if the whole server crashed we would have a reasonable way of restoring all the information from out backup.\r\n\r\n### How to pull dropbox repo unto your local computer:\r\n\r\n1. Existing dropbox owner needs to share the ```repos``` folder (contains ```dj_ap_server``` repo) with your dropbox account.\r\n2. You can't actually see the db files in this dropbox folder. To actually see the files, you need to run\r\n\r\n```\r\ngit clone dropbox://repos/dj_ap_server\r\n```\r\n\r\n\r\nsomewhere outside this folder to checkout the git repository.\r\n\r\nThen, you must checkout the ```database``` branch by doing:\r\n\r\n```\r\ngit checkout database\r\n```\r\n\r\nThere should then be 3 files:\r\n\r\nap_data.sql  ap_full.sql  ap_schema.sql\r\n\r\n#### Scripts\r\nYou can checkout the scripts on the ```scrips``` branch by:\r\n\r\n```\r\ngit checkout scripts\r\n```\r\n	Production Server (ap.ftta.lan)	21	74	1798
